import React, { Component } from 'react';
import Navbarr from './Admin/js/Menu1';
import Login from './Admin/Login';



export default class App extends Component {
  state={
    token:""
  }

  render() {
    return( 
    <div>
<Login/>

<BrowserRouter>
    <Routes>
      <Route exact path="/" element={<div style={{marginTop:'0px'}}><Dashboard/><Nashprinsip/><Kurs/><Xabaryuborish/><Accordion/></div>}/>
      <Route path="/teamId" element={<Narxlar />} />
      <Route path="/python" element={<Python/>} />
      <Route path="/scratch" element={<Scratch/>} />
      <Route path="/javascript" element={<Javaskript />} />
      <Route path="/php" element={<PHP />} />
      <Route path="/mentalarifmetika" element={<MentalArifmetika />} />
      <Route path="/new" element={<Allpreyekt />} />
      <Route path="/new2" element={<Allpreyekt2 />} />
      <Route path="/tush1232" element={<div>{this.state.token?(<Login/>):(<Menu1/>)}</div>} />
    </Routes>
  </BrowserRouter>
    </div>
    )
  }
}
